import React from "react";
import {useState} from 'react'

export default function Login(){

    const [name,setName] = useState("");
    const [email,setEmail] = useState("");
    const [password,setPassword] = useState("");

    const onSubmit = async (e) =>{
        e.preventDefault();
        let result = await fetch('http://localhost:5000/register',{method:"post",body: JSON.stringify({ name , email ,password }),
        headers: {
            'Content-Type': 'application/json'
        }});
        console.log(result);
    }
    return(
        <>

            {/* <form>
                <input value={name} onChange={(e) => setName(e.target.value)} type="text" placeholder="name" />
                <input value={email} onChange={(e) => setEmail(e.target.value)} type="email" placeholder="email" />
                <input value={password} onChange={(e) => setPassword(e.target.value)} type="password" placeholder="password" />
                <button onClick={onSubmit} type="submit">submit</button>
            </form>     */}

<form>
<div class="mb-3">
    <label for="username" class="form-label">Name</label>
    <input type="text" value={name} onChange={(e) => setName(e.target.value)} class="form-control" id="username" aria-describedby="emailHelp" />
    <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
  </div>
  <div class="mb-3">
    <label for="exampleInputEmail1" class="form-label">Email address</label>
    <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
    <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
  </div>
  <div class="mb-3">
    <label for="exampleInputPassword1" class="form-label">Password</label>
    <input type="password" class="form-control" id="exampleInputPassword1" />
  </div>
  <div class="mb-3 form-check">
    <input type="checkbox" class="form-check-input" id="exampleCheck1" />
    <label class="form-check-label" for="exampleCheck1">Check me out</label>
  </div>
  <button type="submit" class="btn btn-primary">Submit</button>
</form>

        </>
    );
};
